import React from 'react'
import './CSS/style.css'
import { Link } from 'react-router-dom';
import { FaHome} from 'react-icons/fa';

const Nav = () => {
  return (
    <>
    <div className="navBar">
        <div className="menu">
        <Link to="/" className='Home'><FaHome className='Home-ico'/> Home</Link>
        </div>
        
    </div>
    </>
  )
}

export default Nav
